import React from 'react';

type Props = {
    //TODO CREATE MODEL AGENDA EXP
    id: number;
    fechaInicioEvento: Date;
    fechaFinEvento: Date;
    diaCompleto: boolean;
    descripcion: String;
    expedienteId: number;
    documentoExpId: number;
    tipoEventoAgenda: String;
    actuacionExpIdList: Array<number>;
    expedienteFusionId: number;
}

const Agenda: React.FC<Props> = ({
    id,
    fechaInicioEvento,
    fechaFinEvento,
    diaCompleto,
    descripcion,
    expedienteId,
    documentoExpId,
    tipoEventoAgenda,
    actuacionExpIdList,
    expedienteFusionId,
}) => (
    <div>
        <p className="number">
            id: {id}
        </p>
        <div>
            {actuacionExpIdList.map(actuacionExpId => (
                <div>
                    <span dangerouslySetInnerHTML={{ __html: actuacionExpId}}></span>
                </div>
            ))}
        </div>
    </div>
);

export default Agenda;
